import { Box } from "@mui/system";
import { useEffect } from "react";
import axios from "axios";

const Autocomplete = () => {
  useEffect(() => {
    const config = {
      method: "get",
      url: "https://maps.googleapis.com/maps/api/place/autocomplete/json?input=Vict&types=geocode&language=fr&key=AIzaSyCdLmmlsKudTLknJq-f3z0Yz-YMUSrZ4LU",
      headers: {},
    };

    axios(config)
      .then(function (response) {
        console.log(JSON.stringify(response.data));
      })
      .catch(function (error) {
        console.log(error);
      });
  }, []);

  return (
    <Box>
      <h1>Autocomplete</h1>
      <Autocomplete
        id="disabled-options-demo"
        options={timeSlots}
        getOptionDisabled={(option) =>
          option === timeSlots[0] || option === timeSlots[2]
        }
        sx={{ width: 300 }}
        renderInput={(params) => (
          <TextField {...params} label="Disabled options" />
        )}
      />
    </Box>
  );
};

export default Autocomplete;
